(33, 18, '197.250.229', 18, 'admin', '2021-07-15 12:37:46', 'terms and conditions updated', 'a:3:{s:19:\"txtDefaultHtmlArea1\";s:511:\"<p>All subscribers of TRAGOAH UNITED services agree to be bound by the terms of this service. TRAGOAH UNITED software is an entire solution for all type of business plan like Binary. This is developed by a leading MLM software development company TRAGOAH UNITED. More over these we are keen to construct MLM software as per the business plan suggested by the clients.This MLM software is featured of with integrated with SMS, E-Wallet,Replicating Website,E-Pin,E-Commerce, Shopping Cart,Web Design and more.</p>\";s:7:\"lang_id\";s:1:\"1\";s:14:\"content_submit\";s:6:\"Update\";}', 0),
(34, 18, '197.250.229', 18, 'admin', '2021-07-15 12:40:07', 'welcome letter updated', 'a:5:{s:18:\"txtDefaultHtmlArea\";s:1109:\"<p>Dear Distributor, Congratulations on your decision...! A journey of thousand miles must begin with a single step. I&#39;d like to welcome you to TRAGOAH UNITED. We are excited that you have accepted our business offer and agreed upon your start date. I trusted that this letter finds you mutually excited about your new opportunity with TRAGOAH UNITED. Each of us will play a role to ensure your successful integration into the company. Your agenda will involve planning your orientation with company and setting some initial work goals so that you feel immediately productive in your new role. And furthur growing into an integral part of this business. Please note we are providing you an opportunity to earn money which is optional, your earnings will depend directly in the amount of efforts you put to develop your business. Again, welcome to the team. If you have questions prior to your start date, please call me at any time, or send email if that is more convenient. We look forward to having you come onboard. The secret of success is constancy to purpose.asdas ALL THE BEST, SEE YOU AT TOP!!</p>\";s:7:\"lang_id\";s:1:\"1\";s:7:\"setting\";s:6:\"Update\";s:14:\"product_matter\";s:0:\"\";s:9:\"logo_name\";s:21:\"logo_113310_thumb.png\";}', 0),
